import React from 'react'
import ReactDom from 'react-dom'
import Uppericons from './uppericons'
import Lowericons from './lowericons'
const MainLayout = () => {
    return (


        <div className = "main-layout" >
     
        <div class = "row" >
        <div class = "col-sm-2" >
        <Uppericons / >
        </div>
        <div class="col-sm-8">
        
        <img src = {
            require('../icons/.png')}className = "" / >
        
        
        
        
        </div>
        < div class = "col-sm-2" >
        <Lowericons />
        </div>
    
        

        </div>
</div>

    );
}

export default MainLayout;
